import React, { Component } from 'react';
import { StlViewer } from 'react-stl-file-viewer';

class StlRenderer extends Component{
    
    render(){
        const style = {
            top: 0,
            left: 0,
            width: '100vw',
            height: '100vh',
        }

        return (
        
            <StlViewer
                style={style} 
                url={this.props.file}
                orbitControls
                shadows
                //volume={(val) => {this.setState({volume:val})}}
            /> 
        
        )
    }
}

export default StlRenderer;
